    noted that several donors appeared to have exceeded the limits set forth in the
    Act. The Committee has reviewed its records and made appropriate amendments to
    the report to show that no donors have exceeded the limits. Most of the errors
    were due to the double reporting of redesignations and reattributions; they were
    reported both in the quarter during which they were made and again in the period
    covered by this report. In two instances, other errors were at fault. For the
    The Goldman Sachs Group, Inc. PAC, a contribution made Nov. 19, 2010, which had
    been designated to retired debt from the 2010 General was incorrectly designated
    for the 2012 Primary. Memo transactions on this amended report correct the designation.
    Contributions by Michael M. Morgan and Judy Morgan made Feb. 25, 2011, were incorrectly
    designated by the Committee as General 2012 contributions, so that contributions
    made in September appeared to put both donors in excess of the limits. Memo transactions
    on this amended report correct the designation of the Feb. 25 contributions.\"\n"
